BEGIN TRANSACTION;
CREATE TABLE user (
id INTEGER CONSTRAINT PK_USERRC PRIMARY KEY AUTOINCREMENT NOT NULL,
first_name VARCHAR(30),
last_name VARCHAR(30),
role VARCHAR(30),
email VARCHAR(30) NOT NULL,
last_login time,
is_active BOOLEAN DEFAULT 0 NOT NULL,
pass VARCHAR(200),
activationid VARCHAR(100),
uuid VARCHAR(43) NOT NULL,
UNIQUE (email),
UNIQUE (activationid));
CREATE TABLE ragtime_migrations (id varchar(255), created_at varchar(32));
CREATE TABLE "Veza" (
	`Parent`	TEXT NOT NULL,
	`Child`	TEXT NOT NULL,
	PRIMARY KEY(Parent,Child)
);
CREATE TABLE "JUS" (
	`JUSId`	TEXT,
	`Direktiva`	TEXT,
	`JUSopis`	TEXT,
	`Glasnik`	TEXT,
	`Naredba`	INT,
	`Locked`	INT,
	`Link-n`	TEXT,
	`Link-d`	TEXT,
	`JUSgodina`	INTEGER
);
